require.config({"config": {
        "text":{"Magento_OfflinePayments/template/payment/purchaseorder-form.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"payment-method\" data-bind=\"css: {'_active': (getCode() == isChecked())}\">\n    <div class=\"payment-method-title field choice\">\n        <input type=\"radio\"\n               name=\"payment[method]\"\n               class=\"radio\"\n               data-bind=\"attr: {'id': getCode()}, value: getCode(), checked: isChecked, click: selectPaymentMethod, visible: isRadioButtonVisible()\"/>\n        <label data-bind=\"attr: {'for': getCode()}\" class=\"label\">\n            <span data-bind=\"text: getTitle()\"></span>\n        </label>\n    </div>\n\n    <div class=\"payment-method-content\">\n        <!-- ko foreach: getRegion('messages') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n        <!--/ko-->\n        <div class=\"payment-method-billing-address\">\n            <!-- ko foreach: $parent.getRegion(getBillingAddressFormName()) -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n        <form id=\"purchaseorder-form\" class=\"form form-purchase-order\" data-role=\"purchaseorder-form\">\n            <fieldset class=\"fieldset payment method\" data-bind='attr: {id: \"payment_form_\" + getCode()}'>\n                <div class=\"field field-number required\">\n                    <label for=\"po_number\" class=\"label\">\n                        <span><!-- ko i18n: 'Purchase Order Number'--><!-- /ko --></span>\n                    </label>\n                    <div class=\"control\">\n                        <input type=\"text\"\n                               id=\"po_number\"\n                               name=\"payment[po_number]\"\n                               data-validate=\"{required:true}\"\n                               data-bind='\n                                attr: {title: $t(\"Purchase Order Number\")},\n                                value: purchaseOrderNumber'\n                               class=\"input-text\"/>\n                    </div>\n                </div>\n            </fieldset>\n\n            <div class=\"checkout-agreements-block\">\n                <!-- ko foreach: $parent.getRegion('before-place-order') -->\n                    <!-- ko template: getTemplate() --><!-- /ko -->\n                <!--/ko-->\n            </div>\n\n            <div class=\"actions-toolbar\" id=\"review-buttons-container\">\n                <div class=\"primary\">\n                    <button class=\"action primary checkout\"\n                            type=\"submit\"\n                            data-bind=\"\n                            click: placeOrder,\n                            attr: {title: $t('Place Order')},\n                            enable: (getCode() == isChecked()),\n                            css: {disabled: !isPlaceOrderActionAllowed()}\n                            \"\n                            data-role=\"review-save\">\n                        <span data-bind=\"i18n: 'Place Order'\"></span>\n                    </button>\n                </div>\n            </div>\n        </form>\n    </div>\n</div>\n\n"}
}});
